0\n►Monitor: ACER Predator XB273KS (27\", UHD, 144Hz, HDR 400, G-Sync)\n►Mouse: Logitech G502 HERO\n►Keyboard: Logitech G910 Orion Spectrum RGB\n►Gaming Headseat: ASUS ROG Centurion True 7.1\n►Gaming Speakers: Logitech G560 Lightsync 2.1 Black\n►Microphone: HyperX QuadCast\n►Steering Wheel \u0026 Pedals: Logitech G923 TrueForce\n►Controller: Xbox 360 PC controller\n►Joystick: Logitech Extreme 3D Pro\n►Gaming Chair: Cougar Fusion Orange\n\nStreaming \u0026 Capture PC Specs:\n\n►Capture Card: Elgato Game Capture 4K60 Pro MK.2\n►Capture Card: AVerMedia Live Gamer 4K GC573 RGB\n►CPU: Intel Kaby Lake, Core i7 7700K 4.20GHz\n►CPU Cooler: NZXT Kraken X41\n►Graphics Card: MSI GeForce GTX 1080 GAMING X 8GB DDR5X 256-bit\n►Motherboard: MSI Z270 GAMING PRO \n►RAM: Corsair Vengeance LPX Black 32GB DDR4\n►SSD: SSD Kingston A2000 1TB\n►HDD: WD Black 4TB SATA-III 7200RPM 128MB\n►Power Supply: Corsair HXi Series HX850i \n►Case: NZXT Noctis 450 Black \n►OS: Windows 10\n►Monitor: Dell Gaming S2721HGF (27\", Curved, 144Hz, G-Sync)\n\n------------------------------------------\nFollow Us:\n\n►Instagram -   / throneful.k  \n►Twitter -   / kronevg  \n►Facebook -   / throneful  \n►Steam - https://steamcommunity.com/profiles/7...\n\nContact:\n\n►Yahoo Mail: KroneVGames@yahoo.com\n\n------------------------------------------\nGame Information:\nApex Legends is the award-winning, free-to-play Battle Royale team shooter from Respawn Entertainment. Master an ever-growing roster of legendary characters with powerful abilities and experience strategic squad play and innovative gameplay in the next evolution of Battle Royale.\n\nConquer with character in Apex Legends, a free-to-play* Battle Royale shooter where legendary characters with powerful abilities team up to battle for fame \u0026 fortune on the fringes of the Frontier. Master an ever-growing roster of diverse Legends, deep tactical squad play and bold new innovations that level up the Battle Royale experience—all within a rugged world where anything goes. Welcome to the next evolution of Battle Royale.\n\nA Roster of Legendary Characters\n\n-Master a growing roster of powerful Legends, each with their own unique personality, strengths and abilities that are easy to pick up but challenging to truly master.\n\nBuild Your Crew\n\n-Choose your Legend and combine their unique skills together with other players to form the ultimate crew.\nStrategic Battle Royale\n\n-Use your abilities–and your wits–to make strategic calls on the fly, adapting your crew's strengths to meet new challenges as the match evolves.\n\nGenre-Evolving Innovation\n\n-Experience a brand-new array of innovative features that level up the Battle Royale genre, including Respawn Beacons, Smart Comms, Intelligent Inventory and an all-new way to drop into the action with Jumpmaster deployment.\n\nSweet, Sweet Loot\n\n-Drop in and loot up with a host of powerful weapons, diverse attachments and useful armor to protect you in battle. After the fight, collect a wealth of cosmetic options for personalizing your character and weapons, and unlock new ways to show off during the match.\n__________________________________________\n#ApexLegends","commandRuns":[{"startIndex":1614,"length":17,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJsDEM2rARgBIhMIw87P3uCvjAMVpFp6BR3hmhnrSOT6oP2yhNr9UA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjVlQWRiREpRc3AybmZ3cDRwbWZxQmdUSENOd3xBQ3Jtc0ttWUlSWTk4LU1YOWxJek10ZEwtcTFXSkluZUFnSVlTb2JWMERVUHVYX3k1MnNJRmhIMmEwbmlEak91a1RCZ2VCM0NLYmxvUG9leUZGU3NwV0pqcTdLcDR0eEdhel83c1gtWHhKZUpacVRVcjVmSGZUbw\u0026q=https%3A%2F%2Fwww.instagram.com%2Fthroneful.k%2F\u0026v=UPtoIy-oPWQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjVlQWRiREpRc3AybmZ3cDRwbWZxQmdUSENOd3xBQ3Jtc0ttWUlSWTk4LU1YOWxJek10ZEwtcTFXSkluZUFnSVlTb2JWMERV OS: Windows 10\n►Monitor: ACER Predator XB273KS (27\", UHD, 144Hz, HDR 400, G-Sync)\n►Mouse: Logitech G502 HERO\n►Keyboard: Logitech G910 Orion Spectrum RGB\n►Gaming Headseat: ASUS ROG Centurion True 7.1\n►Gaming Speakers: Logitech G560 Lightsync 2.1 Black\n►Microphone: HyperX QuadCast\n►Steering Wheel \u0026 Pedals: Logitech G923 TrueForce\n►Controller: Xbox 360 PC controller\n►Joystick: Logitech Extreme 3D Pro\n►Gaming Chair: Cougar Fusion Orange\n\nStreaming \u0026 Capture PC Specs:\n\n►Capture Card: Elgato Game Capture 4K60 Pro MK.2\n►Capture Card: AVerMedia Live Gamer 4K GC573 RGB\n►CPU: Intel Kaby Lake, Core i7 7700K 4.20GHz\n►CPU Cooler: NZXT Kraken X41\n►Graphics Card: MSI GeForce GTX 1080 GAMING X 8GB DDR5X 256-bit\n►Motherboard: MSI Z270 GAMING PRO \n►RAM: Corsair Vengeance LPX Black 32GB DDR4\n►SSD: SSD Kingston A2000 1TB\n►HDD: WD Black 4TB SATA-III 7200RPM 128MB\n►Power Supply: Corsair HXi Series HX850i \n►Case: NZXT Noctis 450 Black \n►OS: Windows 10\n►Monitor: Dell Gaming S2721HGF (27\", Curved, 144Hz, G-Sync)\n\n------------------------------------------\nFollow Us:\n\n►Instagram -   / throneful.k  \n►Twitter -   / kronevg  \n►Facebook -   / throneful  \n►Steam - https://steamcommunity.com/profiles/7...\n\nContact:\n\n►Yahoo Mail: KroneVGames@yahoo.com\n\n------------------------------------------\nGame Information:\nApex Legends is the award-winning, free-to-play Battle Royale team shooter from Respawn Entertainment. Master an ever-growing roster of legendary characters with powerful abilities and experience strategic squad play and innovative gameplay in the next evolution of Battle Royale.\n\nConquer with character in Apex Legends, a free-to-play* Battle Royale shooter where legendary characters with powerful abilities team up to battle for fame \u0026 fortune on the fringes of the Frontier. Master an ever-growing roster of diverse Legends, deep tactical squad play and bold new innovations that level up the Battle Royale experience—all within a rugged world where anything goes. Welcome to the next evolution of Battle Royale.\n\nA Roster of Legendary Characters\n\n-Master a growing roster of powerful Legends, each with their own unique personality, strengths and abilities that are easy to pick up but challenging to truly master.\n\nBuild Your Crew\n\n-Choose your Legend and combine their unique skills together with other players to form the ultimate crew.\nStrategic Battle Royale\n\n-Use your abilities–and your wits–to make strategic calls on the fly, adapting your crew's strengths to meet new challenges as the match evolves.\n\nGenre-Evolving Innovation\n\n-Experience a brand-new array of innovative features that level up the Battle Royale genre, including Respawn Beacons, Smart Comms, Intelligent Inventory and an all-new way to drop into the action with Jumpmaster deployment.\n\nSweet, Sweet Loot\n\n-Drop in and loot up with a host of powerful weapons, diverse attachments and useful armor to protect you in battle. After the fight, collect a wealth of cosmetic options for personalizing your character and weapons, and unlock new ways to show off during the match.\n__________________________________________\n#ApexLegends","commandRuns":[{"startIndex":1614,"length":17,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBgQ040EGAYiEwjDzs_e4K-MAxWkWnoFHeGaGetI5Pqg_bKE2v1Q","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnNDaE9nZFRsVVFoOFJwZXJYY0RNSzhwdjhhd3xBQ3Jtc0tsaFJ0ZkJQcjNUMHZmenJtMjhZQ2N0V0kzUVU3dWcwSjlDQ2V4bjlJeTFoMnRLdzB2OHlVY0ZDcFRxX2JPSTRGOEYwX20xYWlHb1QzUm1oSDctX1JhSUQxNU1WSV9uQWItbU5ZWHcxNnpKMVpiNWppbw\u0026q=https%3A%2F%2Fwww.instagram.com%2Fthroneful.k%2F\u0026v=UPtoIy-oPWQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnNDaE9nZFRsVVFoOFJwZXJYY0RNSzhwdjhhd3xBQ3Jtc0tsaFJ0ZkJQcjNUMHZmenJtMjhZQ2N0V0kzUVU3dWc
